import React from "react";
import Amazon from "./Amazon";
import Card from "./Card";
import NetFlixx from "./NetFlixx";
import Sdata from "./Sdata";

// const FavSeries = "Netflix";
const FavSeries = "Amazon";

const FavS = () => {
  if (FavSeries === "Netflix") {
    return <NetFlixx />;
  } else {
    return <Amazon />;
  }
};

const Netflix = () => {
  return (
    <>
      <h1 className="heading-style">List of TOP Most Webseries in Netflix</h1>
      <FavS />
      {Sdata.map((val) => {
        return (
          <Card
            key={val.id}
            imgsrc={val.imgsrc}
            title={val.title}
            sname={val.sname}
            links={val.links}
          />
        );
      })}
    </>
  );
};

export default Netflix;
